sympy.sympy.polys.densebasic.dmp_strip:
def dmp_strip(f: dmp[Er], u: int, K: Domain[Er] | None = None) -> dmp[Er]:
    """
    Remove leading zeros from ``f`` in ``K[X]``.

    Examples
    ========

    >>> from sympy.polys.densebasic import dmp_strip

    >>> dmp_strip([[], [0, 1, 2], [1]], 1)
    [[0, 1, 2], [1]]

    """
    if not u:
        return _dmp(dup_strip(_dup(f), K))

    if dmp_zero_p(f, u):
        return f

    i, v = 0, u - 1

    for c in f:
        if not dmp_zero_p(c, v):
            break
        else:
            i += 1

    if i == len(f):
        return dmp_zero(u, K)
    else:
        return f[i:]

sympy.sympy.polys.domains.algebraicfield:
def __eq__(self, other):
    """Returns ``True`` if two domains are equivalent. """
    if isinstance(other, AlgebraicField):
        return self.dtype == other.dtype and self.ext == other.ext
    else:
        return NotImplemented

